import { useDispatch, useSelector } from 'react-redux'
import { listAllOrders } from '../redux/actions/orderAction';

const OrderList = () => {
    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(listAllOrders());
    }, [])

    const all_orders_data = useDispatch(state => state.order.data ? state.order.data : []);

    useEffect(() => {
        console.log(all_orders_data);
    }, [all_orders_data])

    return (
        <h2>Comfon</h2>
    )
}

